import axiosInstance from './axiosInstance';

// const { REACT_APP_API_KEY } = process.env;

export default async function getInfo(url) {
  console.log(process.env);
  try {
    const info = await axiosInstance.get(`${url}`);
    return info.data.data;
  } catch (err) {
    return getInfo(url);
  }
}
